import React from "react";
import PostItem from "./PostItem";

const PostList = (poss) => {
	return (
		<div>
			<h1 style={{ textAlign: 'center' }}>center</h1>
			{poss.map(post =>
				<PostItem postW={post} key={post.id} />)
			}
		</div>
	)
}

export default PostList
